         $(document).on('click','.addwishlist',function(){
             var cid = $(this).data('cid');
         var type = $(this).attr('data-type');
         
         var me = $(this);
         if ( me.data('requestRunning') ) {
           return;
         }
         me.data('requestRunning', true);
         
         $.ajaxSetup({
           headers: { 'X-CSRF-TOKEN': $('input[name="_token"]').val() }
         });
         $.ajax({
           type: 'POST',
           url: 'https://www.skillrary.com/course/wishlist',
           data:'cid='+cid+'&type='+type,
           success : function(data) {
             var obj = jQuery.parseJSON(data);
             if(obj.status=='0'){
               if(type=='0'){
                 $('.changeicon-'+cid+' .icon-'+cid).html('<i class="fa fa-heart-o"></i>');
                 $('.changeicon-'+cid).attr('data-type',1);
                 msg = "Wishlist has been removed successfully";
               }else if(type=='1'){
                 $('.changeicon-'+cid+' .icon-'+cid).html('<i class="fa fa-heart"></i>');
                 $('.changeicon-'+cid).attr('data-type',0);
                 msg = "Wishlist has been added successfully";
               }
         
               toastr.success("Success", msg);
               toastr.options = {
                 "closeButton": true,
                 "debug": false,
                 "positionClass": "toast-bottom-right",
                 "onclick": null,
                 "showDuration": "300",
                 "hideDuration": "1000",
                 "timeOut": "5000",
                 "extendedTimeOut": "1000",
                 "showEasing": "swing",
                 "hideEasing": "linear",
                 "showMethod": "fadeIn",
                 "hideMethod": "fadeOut"
               }
             }else if(obj.status=='1'){
               toastr.error("Error", "Sorry! Please login first");
               toastr.clear();
               toastr.options = {
                 "closeButton": true,
                 "debug": false,
                 "positionClass": "toast-bottom-right",
                 "onclick": null,
                 "showDuration": "300",
                 "hideDuration": "1000",
                 "timeOut": "2000",
                 "extendedTimeOut": "1000",
                 "showEasing": "swing",
                 "hideEasing": "linear",
                 "showMethod": "fadeIn",
                 "hideMethod": "fadeOut",
                 "preventDuplicates":true,
               }
             }else if(obj.status=='2'){
               toastr.error("Error", "Sorry! Something went wrong please try again later.");
               toastr.options = {
                 "closeButton": true,
                 "debug": false,
                 "positionClass": "toast-bottom-right",
                 "onclick": null,
                 "showDuration": "300",
                 "hideDuration": "1000",
                 "timeOut": "5000",
                 "extendedTimeOut": "1000",
                 "showEasing": "swing",
                 "hideEasing": "linear",
                 "showMethod": "fadeIn",
                 "hideMethod": "fadeOut"
               }
             }
         
             return false;
         
           },complete: function() {
             me.data('requestRunning', false);
           }
         });
         
         })
